import React from "react";
import Header from './Header'
import Hero from './Hero'
import Main from './Main'
import Footer from "./Footer";
Header = <Header />;
Hero = <Hero />
Main = <Main /> 
Footer = <Footer />

Home = (Header, Hero, Main, Footer);

function App(){
    let component
    switch (window.location.pathname) {
        case "/":
            component = <Header />, <Hero />
            break
    }
    return(
    <div>
        <Header />
        <Hero />
        <Main />
        <Footer />
    </div>
    )
}

export default App
